ie ton dessin', '0', '0', '2008-11-10 00:00:00'), ('1128', '1062', '2', 'très mignonne, j\'adore le chat ^^  de quoi parle ton mangas?', '0', '0', '2008-11-16 00:00:00'), ('1130', '1046', '28', '*si tu savais combien de temps j\'ai passé a faire ces shoes...* au moins 20min =D j\'voulais vraiment les faire elaborées, du coup c\'est ma partie preferé dans le dessin^^oui ca doit etre confortable, enfin, j\'sais pas trop quel matiere mettre a l\'interieur mais comme on me l\'a fait remarqué \"ca doit pas etre super pratique pour courir!\" ...enfin, c\'est style jeu vidéos quoi :p--> moi ces petites ailes sur son chapeau j\'pensais plutot a celle derriere la \"cape\" de linoa dans FFVII, ou a mario, quand il mange sa carotte/fraise?? magique, mais c\'est vrai que il y a un costume de sakura avec ces ailes, j\'y avais pas pensé ^^*j\'parle toujours trop, je sors ^^\"*', '0', '1', '2008-11-16 00:00:00'), ('1131', '1062', '28', 'j\'aime beaucoup^^faudrait que tu nous poste des planche de ton manga, ou un pitit lien (si ce n\'est pas deja fait ^^\")', '0', '0', '2008-11-16 00:00:00'), ('1132', '1063', '28', 'pas mal, moi je trouve le decor assez reussi (ptet parce que j\'fais jamais de decor, ca pourri le dessin apres xD),enfin, misa se confond un peu trop avec le decor, et ses bottes son pas mal, mais j\'trouve que la gauche aurait peut etre due etre legerement decollée du sol pour suivre plus la forme du pied a l\'interieur ;)enfin c\'est ptet fait expres, c\'est juste que ma prof d\'art appliqué est ses critiques deteigne un peu sur moi (le truc lourd, surtout quand on passe longtemsp sur un dessin et qu\"elle te dit que c\'est moche) donc voila, desolé si les critiques sont mal placées ^^\"', '0', '0', '2008-11-16 00:00:00');
