('1748', '650', '5', 'On gagne quoi ? lol\r\nSon bras est trop fin et son serre tête est reculé, une trop grande franche, car un trop grand front.\r\nje vais me faire délapider par tes fans :p Mais j\'en suis une aussi de tes fans, hein ! ;-)', '3', '1', '2010-06-11 19:45:43'), ('1749', '438', '5', 'Tu as su apporter ta touche perso sur ce dessin copié. Sa bouille est plus mignonne que l\'original. Un petit effet ou détail dans la loupe aurait été bienvenue.', '2', '0', '2010-06-11 19:51:55'), ('1750', '541', '5', 'décalqué ? Ou très mal copié ? C\'est étrange sur tes dessins fait par toi, on voit que tu ne maitrises pas les mains (par exemple) et sur ceux là ce problème disparaît..', '3', '0', '2010-06-11 20:02:37'), ('1751', '545', '5', 'Très bien copié. Tu fais les ombres en tartinant avec tes doigts c\'est ça ? Je faisais pareil aussi jadis, jusqu\'à ce que notre prof d\'arts plastiques au Lycée nous gronde de procéder ainsi et avec le recul il avait bien raison.', '1', '0', '2010-06-11 20:07:26'), ('1752', '294', '5', 'Je réponds deux ans plus tard, j\'ai utilisé si je me souviens bien, de la gouache extra fine, de l\'encre d\'aquarelle et de la peinture dorée. J\'avais un pinceau tout foutu, écrasé qui m\'a permis de faire les effets sur son pantalon. A propos le personnage est une copie, je me suis permise de le mettre car je pense avoir apporter ma griffe dessus :-C', '3', '0', '2010-06-11 20:14:29'), ('1753', '282', '5', 'Bah alors je l\'ai supprimé cette horreur euh je veux dire ce dessin :pQue fait t\'il encore là :-C \r\nMa sailor mars est vraiment trop mal fichue, j\'ai honte !', '1', '0', '2010-06-11 20:19:07'), ('1754', '840', '5', 'Crois moi Kikumi, dans quelques années, voir moins selon ta progression, tu penseras le contraire. Je te le dis pas expérience, j\'étais super fière de mes dessins jadis sur le coup et après avec le temps, j\'ai vite déchanté. Le problème chez les apprentis artiste c\'est un paradoxe entre le manque d\'assurance dans leur 