0:00', '0000-00-00 00:00:00'), ('791', 'sonoko', '174', 'sa c\'est un peso dans naruto qui ji invanti ^^ pas mal ^^ mais bon... se dessin il est vieux et sonoko je l\'ai invanter bien avant tombo mais le déssin quand je regarde les mien il y a une grande évolution mais bon... c\'est une fille coquine trés curieuse aussi trés intéligente ( quand elle s\'éforce ) elle s\'affolle parfoit trés facilement et aime bien les garçon du genre naruto bon... enbef c\'est une fille trés centimental. je vous raconterais sont histoire plus tard a++ tout le monde !', '69', '92', '0', '0', '2008-08-15 00:00:00', '0000-00-00 00:00:00'), ('792', 'sangoku niveau 2', '16', '', '23', '114', '0', '0', '2008-08-15 00:00:00', '0000-00-00 00:00:00'), ('793', 'elphe 7', '174', 'c\'est une hautre elphe ont a l\'impréssin que ce dessin est tristre parceque il n\'apas beaucoup de couleur mais elle a quand même 7 ou six couleur vous alez me dire nan elle en a 5 mais nan elle en a bien 6 parce que il y a un bleu de mer et un bleu foncer mais on a vraiment l\'impréssion que c\'est le même bleu mais nan la preuve j\'ai pas utiliser le même crayon a++', '69', '78', '0', '0', '2008-08-16 00:00:00', '0000-00-00 00:00:00'), ('794', 'elphe spécial', '174', 'encore une autre elphe mais cette foie celle la elle est spécial c\'est une elphe des neige bon sa se voie pas tros mais elle a des bottes marron elle a aussi des gants marron les cheveux claire pour rapeller la neige un sac noire mais a la base je voulais faire une écharpe mais sa la mal fais alors je me suis ratraper et c\'était juste ! bon... a++ tout le monde !', '69', '60', '0', '0', '2008-08-16 00:00:00', '0000-00-00 00:00:00'), ('795', 'Mangekyô Sharingan', '183', 'Et voici la skin de son Mangekyô qu\'elle aura peut etre dans le scénar.\r\nEntre nous, je le préfère à celui de Sasuke ! lol.', '44', '177', '0', '0', '2008-08-17 00:00:00', '0000-00-00 00:00:00'), ('796', 'InO', '188', 'Coucou !\r\nvoila mon premier fanart sur ce site !\r\nvoici In